import React from 'react';

import Goal from './Goal';

const CurrentGoalList = () => {
   const data = [{
      name: "Walk a mile a day",
      "add-code": "XYZ123"
   },
   {
      name: "Walk a mile a day",
      "add-code": "ABC123"
   },
   {
      name: "Walk a mile a day",
      "add-code": "DFG123"
   },
   {
      name: "Walk a mile a day",
      "add-code": "JFK123"
   },
   {
      name: "Walk a mile a day",
      "add-code": "DYZ123"
   },{
      name: "Walk a mile a day",
      "add-code": "DOL123"
   },
   {
      name: "Walk a mile a day",
      "add-code": "THE123"
   }];

   const renderGoals = () => {
      return data.map(
         (goal) => <Goal name={ goal.name } code={ goal.code } />
      );
   };

   return (
      <div>
         { renderGoals() }
      </div>
   );
};

export default CurrentGoalList;
